        void contextMenu1_Popup(object sender, System.EventArgs e)
        {
            (sender as ContextMenu).MenuItems[0].Enabled = Browser.CanGoBack;
            (sender as ContextMenu).MenuItems[1].Enabled = Browser.CanGoForward;
            if (Browser.IsBusy)
                (sender as ContextMenu).MenuItems[2].Text = "Stop";
            else
                (sender as ContextMenu).MenuItems[2].Text = "Refresh";
        }
